<!DOCTYPE html>
<html data-color-mode="light">
<head>
  <title>Render</title>
  <meta name="referrer" content="never">
    <link rel="stylesheet" href="https://render.githubusercontent.com/assets/3d-59079fa3cc9a2883c0ea.css"/>

</head>
<body
   class="is-embedded "
   data-render-url="https://render.githubusercontent.com"
   data-github-hostname="github.com"
   data-client-timeout-attempts="30"
>
  <div class="render-shell js-render-shell"     data-color="0x4183c4"
>
    




<!-- render bar -->
<div class="js-render-bar render-bar render-bar-with-modes">
  <ul class="js-view-modes render-view-modes">
    <li data-mode="wireframe" class="js-view-mode-item">Wireframe</li>
    <li data-mode="normal" class="js-view-mode-item">Surface Angle</li>
    <li data-mode="solid" class="js-view-mode-item active">Solid</li>
  </ul>
  <span class="render-message">
    <a href="https://www.emiia.ai" target="_parent">
      EMIIA.AI ANALYTICS</a><a href="https://github.com" target="_parent">
    </a>
  </span>
</div>
<!-- /render bar -->

<!-- render info -->
<div class="render-info">
  <div class="js-viewer-health render-health">
    <span class="symbol">&#8854;</span>
    <span class="js-message message"></span>
  </div>
</div>
<!-- /render info -->

<!-- render viewport -->
<div id="solid-viewer" class="render-viewport" data-file="https://raw.githubusercontent.com/EMIIA/analytics/654445a0eacd7fe1359720139029daee637891b4/bim/emiia.ai_antenna.stl"></div>
<!-- /render viewport -->

  </div>

    <script src="https://render.githubusercontent.com/assets/3d-59079fa3cc9a2883c0ea.js" type="text/javascript"></script>


</body>
</html>
